description:
Spice Up The Marriage!
Let The Party Begin! Sharing Is Caring! Thanks For The Ride!
Veronica's under-appreciated from husband John because they don't have sex as often as they use to. So Veronica puts out an Ad for a sexy play toy to help both of them with their sex life. Francesca and Mark have a devious plan about getting their hot 19yr old neighbor Staci to join them in a 3-way. Good thing for Francesca that Staci's really into older women. Dana and Manuel rent out a room to young Chastity. Then she starts taking advantage. Manuel gets super pissed at her because it's costing him more for her to be there, so he and Dana teach her about living expenses. Cali gets kicked out of her boyfriend's car and is left stranded on the side of the road. Tommy and Eva just happen to be passing by. They pick her up and give her a ride that she won't forget!

